import React from 'react';
import NFTCard from './NFTCard.jsx'

function Gallery(props) {
    let img = props.list[0].media[0].gateway;
    return (
        <NFTCard imgURL={img} name={props.list[0].title}></NFTCard>
    );
}
export default Gallery;
